// import logo from './logo.svg';
import './App.css';
import './css/style.css';
import logo from './images/appLogo.png';
import Header from "./pageElements/Header";


function App() {
  return (
    <div className="container-fluid">
      <div className="row">
        <Header logo={logo}/>
      </div>
    </div>
  );
}

export default App;
